import { ACTIVE_MOVEMENT } from '../actions/constants.js';

const activeMovementReducer = (state = null, action) => {
    switch (action.type) {
        case ACTIVE_MOVEMENT: 
            return action.payload;
        default:
            return state;
    }
};

export default activeMovementReducer;
